import React from 'react'
import Product from '../../components/Product'
import products from '../../products'
const Painkiller = (props) => {
  return (
    <div>
      <div class='rowCard'>
        {products.find((categoryProduct) => {
          if (categoryProduct.category === props.match.params.category) {
            console.log(categoryProduct)
            return products.forEach((product) =>
              product.map((mapProducts) => {
                ;<Product key={mapProducts._id} product={mapProducts} />
              })
            )
          }
        })}
      </div>
    </div>
  )
}

export default Painkiller
